import React from "react";

import "./Modal.css"
export const Modal = () => {
    return(
        <div className="modal-container">
            <div className="modal">
               <form>
                   <div>
                       <label htmlFor="czynnosc">Czynnosc</label>
                       <input name="czynnosc"/>
                   </div>
               </form>
            </div>
        </div>
    )
}
